    // model input and flattened
    constexpr int flat_size = 5862; 
    std::array<Scalar, flat_size> model_input;

    // normalize input
    for (int i = 0; i < 5862; i++) { model_input[i] = (initial_input[i] - input_shift[i]) / (input_scale[i]); } 

    if (model_input.size() != 5862) { throw std::invalid_argument("Invalid input size. Expected size: 5862"); }

    // Dense, layer 1
    static std::array<Scalar, 8> layer_1_output;
    Dense_MLP_LU<Scalar, 8>(
        layer_1_output.data(), model_input.data(),
        weights_1.data(), biases_1.data(),
        5862, linear, 0.0);

    // UnitNormalization, layer 2
    static std::array<Scalar, 8> layer_2_output;
    UnitNormalization_MLP_LU<Scalar, 8, 1>(
        layer_2_output.data(), layer_1_output.data(),
        epsilon_2);

    // Pure Activation, layer 3
    static std::array<Scalar, 8> layer_3_output;
    for (int i = 0; i < 8; ++i) {
        gelu(layer_3_output[i], layer_2_output[i], 0.0);
    }

    // Dense, layer 4
    static std::array<Scalar, 2> layer_4_output;
    Dense_MLP_LU<Scalar, 2>(
        layer_4_output.data(), layer_3_output.data(),
        weights_4.data(), biases_4.data(),
        8, linear, 0.0);

    // Pure Activation, layer 5
    static std::array<Scalar, 2> layer_5_output;
    for (int i = 0; i < 2; ++i) {
        gelu(layer_5_output[i], layer_4_output[i], 0.0);
    }

    // Dense, layer 6
    static std::array<Scalar, 7656> layer_6_output;
    Dense_MLP_LU<Scalar, 7656>(
        layer_6_output.data(), layer_5_output.data(),
        weights_6.data(), biases_6.data(),
        2, linear, 0.0);

    // Pure Activation, layer 7
    static std::array<Scalar, 7656> layer_7_output;
    for (int i = 0; i < 7656; ++i) {
        nonzero_diag_activation(layer_7_output[i], layer_6_output[i], i);
    }


//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\//\\// 


    static std::array<Scalar, 7656> model_output;

    for (int i = 0; i < 7656; i++) { model_output[i] = (layer_7_output[i] * output_scale[i]) + output_shift[i]; }

    return model_output;

